import { Component, OnInit } from '@angular/core';

@Component({
  selector: 'app-signup',
  templateUrl: './signup.component.html',
  styleUrls: ['./signup.component.css']
})
export class SignupComponent implements OnInit {
  signUpUsers: any[] = [];

  signUpObj: any = {
    username: '',
    email: '',
    password: ''
  };

  constructor() { }

  ngOnInit(): void {
    const localData = localStorage.getItem('signUpUsers');
    if (localData) {
      this.signUpUsers = JSON.parse(localData);
    } else {
      this.signUpUsers = [];
    }
  }

  onSignUp() {
    this.signUpUsers.push(this.signUpObj);
    localStorage.setItem('signUpUsers', JSON.stringify(this.signUpUsers));
    this.signUpObj = {
      username: '',
      email: '',
      password: ''
    };
  }

  onCancel() {
    const form = document.querySelector('.signup-form') as HTMLFormElement;
    form.reset();
  }
}
<div class="container">
    <div>
        <h2>Sign Up</h2>

        <a routerLink="/" class="back-link">< Back</a>
        <form class="signup-form">

            <label for="username">Username:</label>
            <input type="text" id="username" name="username" required [(ngModel)]="signUpObj.username"><br>

            <label for="email">Email:</label>
            <input type="email" id="email" name="email" required [(ngModel)]="signUpObj.email"><br>

            <label for="password">Password:</label>
            <input type="password" id="password" name="password" required [(ngModel)]="signUpObj.password"><br>

            <button type="button" (click)="onSignUp()" class="signup-button">Sign Up</button>
            <button type="button" (click)="onCancel()" class="cancel-button">Cancel</button>
        </form>
    </div>
</div>
